import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import PropTypes from "prop-types";
import { Card, Grid, Divider, Container, Box } from "@mui/material";

// Components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";
import TrimaIcon from "components/CustomIcons/Trima";
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";

const ReportSection = ({ title, children }) => (
  <Box mb={3}>
    <MDTypography variant="h6" fontWeight="medium" mb={1}>
      {title}
    </MDTypography>
    <Box ml={2}>{children}</Box>
  </Box>
);

ReportSection.propTypes = {
  title: PropTypes.string.isRequired,
  children: PropTypes.node.isRequired,
};

const ReportField = ({ label, value }) => (
  <Grid item xs={12} sm={6} md={4}>
    <Box display="flex" flexDirection="column" mb={2}>
      <MDTypography variant="caption" color="text" fontWeight="bold">
        {label}
      </MDTypography>
      <MDTypography variant="body2">{value || "---"}</MDTypography>
    </Box>
  </Grid>
);

ReportField.propTypes = {
  label: PropTypes.string.isRequired,
  value: PropTypes.oneOfType([PropTypes.string, PropTypes.number, PropTypes.node]),
};

ReportField.defaultProps = {
  value: "---",
};

function TrimaReport() {
  const { codigo } = useParams();
  const [reportData, setReportData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchReportData = async () => {
      try {
        setLoading(true);
        const token = localStorage.getItem("authToken");
        const response = await fetch(`${process.env.REACT_APP_API_URL}/api/donorInfo/${codigo}`, {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });

        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }

        const data = await response.json();
        setReportData(data);
        setError(null);
      } catch (error) {
        console.error("Erro ao buscar dados do relatório:", error);
        setError("Erro ao carregar os dados do relatório");
      } finally {
        setLoading(false);
      }
    };

    fetchReportData();
  }, [codigo]);

  return (
    <DashboardLayout>
      <DashboardNavbar />
      <Container maxWidth="lg" sx={{ py: 4 }}>
        <Card>
          <MDBox p={3}>
            {loading && (
              <MDTypography variant="h6" textAlign="center">
                Carregando...
              </MDTypography>
            )}

            {error && (
              <MDTypography variant="h6" color="error" textAlign="center">
                {error}
              </MDTypography>
            )}

            {!loading && !error && reportData && (
              <>
                {/* Cabeçalho */}
                <Box display="flex" alignItems="center" mb={3}>
                  <TrimaIcon sx={{ fontSize: 40, mr: 2 }} />
                  <Box>
                    <MDTypography variant="h4">Relatório de Procedimento Trima</MDTypography>
                    <MDTypography variant="subtitle2" color="text">
                      Código: {codigo}
                    </MDTypography>
                  </Box>
                </Box>

                <Divider sx={{ my: 3 }} />

                {/* Informações do Doador */}
                <ReportSection title="Informações do Doador">
                  <Grid container spacing={2}>
                    <ReportField label="Nome" value={reportData.nomeDoador} />
                    <ReportField label="Data de Nascimento" value={reportData.dataNascimento} />
                    <ReportField label="Tipo Sanguíneo" value={reportData.tipoSanguineo} />
                  </Grid>
                </ReportSection>

                {/* Dados do Procedimento */}
                <ReportSection title="Dados do Procedimento">
                  <Grid container spacing={2}>
                    <ReportField label="Data" value={reportData.dataProcedimento} />
                    <ReportField label="Hora Início" value={reportData.horaInicio} />
                    <ReportField label="Duração" value={reportData.duracao} />
                  </Grid>
                </ReportSection>

                {/* Resultados */}
                <ReportSection title="Resultados">
                  <Grid container spacing={2}>
                    <ReportField label="Volume Processado" value={reportData.volumeProcessado} />
                    <ReportField
                      label="Plaquetas Coletadas"
                      value={reportData.plaquetasColetadas}
                    />
                  </Grid>
                </ReportSection>

                {/* Rodapé */}
                <Box mt={4} pt={3} borderTop={1} borderColor="divider">
                  <MDTypography variant="caption" color="text">
                    Relatório gerado em {new Date().toLocaleString()}
                  </MDTypography>
                </Box>
              </>
            )}
          </MDBox>
        </Card>
      </Container>
    </DashboardLayout>
  );
}

export default TrimaReport;
